export default function Wakayama({ city, updateCity }) {
  const cityClick = (e) => {
    console.log(e.target.id);
    let res = new Set();
    let videoCount = Math.max(6, Math.floor(Math.random() * 15));

    while (res.size < videoCount) {
      let id = Math.floor(Math.random() * 20) + 1;

      if (!res.has(id)) {
        res.add(id);
      }
    }

    updateCity({
      ...data.locations.find((x) => x.name === e.target.id),
      videos: [...res],
    });
  };

  return (
    <>
      <svg className={s.citysMap} xmlns="http://www.w3.org/2000/svg" viewBox="0 0 409 464">
        <defs>
          <clipPath id="mask">
            {ids.map((x, i) => (
              <path
                key={`path-def-${i}`}
                d={ds[i]}
                stroke="black"
                strokeWidth="0.5"
                strokeLinejoin="round"
                id="Wakayama"
              />
            ))}
          </clipPath>
        </defs>
        {/* <path
          d=
          stroke="black"
          onClick={cityClick}
          strokeWidth="0.5"
          strokeLinejoin="round"
          fill={city.name === "Wakayama" ? "#780c0b" : "white"}
          id="Wakayama"
        /> */}
        {ids.map((x, i) => (
          <path
            key={`path-${i}`}
            d={ds[i]}
            onClick={cityClick}
            stroke="black"
            strokeWidth="0.5"
            strokeLinejoin="round"
            datacolor={colors[i]}
            fill={city.name === x ? colors[i] : "white"}
            id={x}
            style={{}}
            onMouseEnter={(e) => {
              if (city.name != x) {
                e.target.setAttribute("fill", colors[i]);
              }
            }}
            onMouseLeave={(e) => {
              if (city.name != x) {
                e.target.setAttribute("fill", "white");
              }
            }}
          />
        ))}
      </svg>
    </>
  );
}
